import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

export { default } from './RubiksCube';
export { default as CubeFace } from './CubeFace/CubeFace';
export { default as CubeNet } from './CubeNet/CubeNet';
export { default as FaceButton } from './Controls/FaceButton';
export { default as FaceControls } from './Controls/FaceControls';
export { default as CubeOperations } from './Controls/CubeOperations';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
